import React, { Component } from 'react'
import {Container} from 'react-bootstrap'
import {Row} from 'react-bootstrap'
import {Col} from 'react-bootstrap'
import './index.css'





class Dasher  extends Component {
    
    render() { 
        return ( 
            <div>
                <Container className='column'>
                    <Row>
                        <Col xs={4} className='col1' >
                            <h5>Thia ia ia</h5>
                            <img src="https://res.cloudinary.com/nseabasi/image/upload/v1581199872/nnse/col1.jpg_blqque.jpg"/>
                        </Col>
                        <Col xs={3} className='col2' ></Col>
                        <Col xs={4} className='col3' ></Col>
                    </Row>
                </Container>
            </div>
            
         );
    }
}
 
export default Dasher;
